import styled from 'styled-components';

export const HomePageContainer = styled.div`
    width: 100%;
	height: 950px;
	background: #FFFFFF;
    z-index: 2;
    
    @media only screen and (max-width: 575px) {
		height: 100vh;
	}
`;

export const homeSliderContainer = styled.div`
    width: 100%;
	height: 950px;
	background: #FFFFFF;
    z-index: 2;
    
    @media only screen and (max-width: 575px) {
		height: 100vh;
	}
`;
